Those customers that both of the following conditions apply to:
1. Customer with a demand greater than 100 kW in any two consecutive months during the most recent twelve (12) months;
2. Customer's energy usage is greater than 25,000 kWh for three or more consecutive months.

Available to all primary metered consumers for commercial and industrial three-phase service, for all uses including lighting, power and heating for loads in excess of 5000 kW metered demand, subject to the established rules and regulations, tariffs, bylaws and Articles of Incorporation of the Association.  Service: Three-phase, 60 hertz, at the Association's standard distribution voltages.  The minimum monthly charge shall be the highest of the following:
1. The minimum monthly charge specified in the Contract;
2. A charge of $1.50 per KVA of required transformer capacity; or
3. The demand charge;
4. Current effective Facilities Charge: $110.00.
Riders will be applied in accordance with rate Schedule R.

Available to all large power consumers for all types of usage for loads in excess of 5,000 kW, subject to the established rules and regulations, tariffs, bylaws and Articles of Incorporation of the Association. Service: Three-phase, 60 hertz, at voltages specified in the Contract. The minimum monthly charge shall be the highest of the following:
1. The minimum monthly charge specified in the Contract;
2. A charge of $1.50 per KVA of required transformer capacity;
3. The demand charge; or
4. Current effective Facilities Charge: $110.00.
Riders will be applied in accordance with rate Schedule R.

