Requirements:
 1. The load must be first served by Planters Emc on or after January 1, 1999; 2. The Member's operation must be such that it results in a level electrical load throughout the year and may not be seasonal in nature unless its season falls outside of the Summer period; 
3. The Member's actual or anticipated average monthly load factor must be 70% or greater; 
4. The load must be metered in accordance with the Cooperative's standard metering practices; and, 
5. The Member and the Cooperative mutually agree upon an agreement for service provided hereunder, including applicable facilities charges.

Available to all primary metered consumers for commercial and industrial three-phase service where dual feeder source is required, for all uses including lighting, power and heating for loads in excess of 5000 kW metered demand, subject to the established rules and regulations, tariffs, bylaws and Articles of Incorporation of the Association.  Service: Three-phase, 60 hertz, at the Association's standard distribution voltages.  The minimum monthly charge shall be the highest of the following:
1. The minimum monthly charge specified in the Contract;
2. A charge of $1.50 per KVA of required transformer capacity; or
3. The demand charge;
4. Current effective Facilities Charge: $110.00.
Riders will be applied in accordance to rate Schedule R.

Minimum bill is $28.75 during summer months and $25.20 during winter months.

Summer months are July 1st to October 1st billings; 
Winter months are November 1st to June 1st billings

